import { FormControl, FormControlLabel, FormLabel, Radio, RadioGroup } from '@material-ui/core';
import React from 'react';

const RadioButton = ({name,value,handleChange}) => {
    return ( 
        <FormControl component="fieldset" style={{display: 'flex', flexDirection: 'row'}}>
        <FormLabel component="legend">Select Level</FormLabel>
        <RadioGroup name="gender1" value={value} style={{display: 'flex', flexDirection: 'row'}} onChange={handleChange}>
          <FormControlLabel value="female" control={<Radio />} label="Female" />
          <FormControlLabel value="male" control={<Radio />} label="Male" />
          <FormControlLabel value="other" control={<Radio />} label="Other" />

        </RadioGroup>
      </FormControl>
     );
}

export default RadioButton;
